import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

var NewComponent = React.createClass({
    render: function() {
      return (
        <div>
          <meta charSet="UTF-8" />
          <meta name="viewport" content="width=device-width, initial-scale=1.0" />
          <title>SITBEMS</title>
          <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.8.1/slick.css" />
          <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.8.1/slick-theme.min.css" />
          <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/aos/2.3.4/aos.css" />
          <link rel="stylesheet" href="css/style.css" />
          <nav>
            <div className="container-fluid">
              <a className="navbar-brand">
                <img src="img/logo.png" alt="" width={500} />
              </a>
              <div className="header">
                <ul>
                  <li><a href="index.html">Home</a></li><a href="index.html">
                  </a><li><a href="index.html" /><a href="firstfloor.html">First Floor</a></li><a href="firstfloor.html">
                  </a><li><a href="firstfloor.html" /><a href="secondfloor.html">Second Floor</a></li><a href="secondfloor.html">
                  </a><li><a href="secondfloor.html" /><a href="thirdfloor.html">Third Floor</a></li><a href="thirdfloor.html">
                  </a><li><a href="thirdfloor.html" /><a href="fourthfloor.html">Fourth Floor</a></li><a href="fourthfloor.html">
                  </a></ul>
              </div>    
            </div>
          </nav>
        </div>
      );
    }
  });
